import React from "react"
import { Grid, Cell } from "react-mdl"

class Resume extends React.Component {
    render() {
        return (
            <div className="">
                <Grid>
                    <Cell col={4}>
                        Left Side
                    </Cell>

                    <Cell className="resume-right-col" col={8}>
                        Right side
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Resume
